import React from 'react'
import './UploadedFile.css'

class UploadedFile extends React.Component {
    render() {
        return (
                <a className='uploadedFile'>
                    <div className='uploadedFileTitle'>
                        {this.props.fileName}
                    </div>
                </a>
        ) 
    }
}

export default UploadedFile
